{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-mac","version":1236}},"contents":[{"attributes":{"line":{"identifier":"97A69998-6892-4E26-B53D-2B7668FF0D7D","header":1}},"text":"Roundpoint Mortgage
"},{"text":"They sent another request for proof of insurance for the mortgage for Mirage Crossing. I spoke to James. He said that they received the personal  insurance information, but they do not have the Condo HOA insurance. He told me to use the web site, but it asks for a reference number and I don’t have one. 

Jeff Hennick sent me a Prof Of Insurance for the HOA, and I sent it on to Insurance@RoundPointMortgage.com"}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-mac","version":1262}},"contents":[{"attributes":{"line":{"identifier":"C9C7AB5B-B27A-4020-AFD1-E61EFB61CD46","header":1}},"text":"Accident
"},{"text":"Talked to Carlos from Traveller’s Insurance. He took a statement from me and recorded it. We both used Google Earth to describe the location of the accident, the orientation of the cars and how it happed.

Lynn and I had just shopped at Home Depot at 7000 Mayo in Scottsdale.  Our 2021 Toyota Corolla car was parked in a parking slot in the westbound direction. There are parking slots all around, but no barriers, bumpers or other definition of the parking slot other than stripes painted on the pavement. There were very few other parked cars.  Our car was oriented such that I could pull out forward into the traffic lane. We walked to our car. I got in the drivers seat and Lynn in the passengers seat. We both put our seat belts on. I started the car, programmed the GPS and prepared to leave. I cleared the right and left forward and began to pull out. Lue Neff-Furnish was driving westbound to get into a parking slot in front of us in the slots across the traffic lane. She came up on my left, I didn’t see her. I started to pull out and angle left when I saw her car too late to prevent the collision. "}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-mac","version":1245}},"contents":[{"attributes":{"line":{"identifier":"1C4CF958-606A-439C-B9AB-A041F41F0842","header":1}},"text":"Accident
"},{"text":"I was called by Briante at State Farm. After some conversation, she told me that Lue was accusing me of not yielding right of way to her. I denied that. I told Briante that I started from a parking space and that Lue came up to me from my blind left side.  I further told her that I have pictures and I uploaded them. Briante asked me if I had any witnesses, and I said no.

Then I talked to Carlos at Travellers and told him of the conversation with Briante."}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":826}},"contents":[{"attributes":{"line":{"header":1,"identifier":"B17FE4FA-C495-4B97-9127-08A5F73AF26C"}},"text":"Sale of Mirage Crossing
"},{"text":"Photographer came yesterday to take pictures and said that the photos would go to Carmella today. 

I already got a random text from “Ron” ( not my cousin ). How did he get my phone number?  "}]}

