{"contents":[{"text":"Hilton
","attributes":{"line":{"identifier":"B5115AD1-95AF-410E-9A33-0FF5AEC487E5","header":1}}},{"text":"I have 2 Hilton Honors accounts. In 1Password, the one to continue using is called Hilton New. I’m trying to transfer all points from Hilton Old and today put in a request to transfer 6000 points. 

After a few days, I’ll check on the transfer. If it’s successful I’ll put in a request to transfer the remaining 800+. If not successful, I need to call Hilton. "}],"meta":{"created":{"platform":"com.bloombuilt.dayone-ios","version":2451},"version":1,"small-lines-removed":true}}
